      true: 'panel-wrapper active',
      false: 'panel-wrapper'
    };
    return (
      <div className={_class[this.state.active]}>
        <div className="over-layer"></div>
        <div className="panel">
          <div className="head">
            <span className="close">x</span>
            <p className="has-text-centered">Children Components</p>
          </div>
        </div>
      </div>
    );
  }
}

